import React, { memo } from 'react';

import topics from './topics';

const Materials = () => {
    return <>
        <h1>Materials</h1>
        <div className="topics">
            {topics.map(topic => 
                <div className="topic-item">
                    {topic.label}
                </div>
            )}
        </div>
    </>
};

export default memo(Materials);
